import React from 'react';
import '../style/cityLine.css';
import { Button } from 'antd/lib/radio';

export default class CilyLineItem extends React.Component{
    constructor(props){
        super(props)
    }
    render(){
        const { cityName, ifChoosed, onCityClick } = this.props;
        return(
            <div className = 'cityDiv' onClick = {onCityClick} style={{cursor: 'pointer'}}>
                <div className = {ifChoosed ? 'choosedCity' : ' generalCity'}>{ cityName }</div>
                <div className = {ifChoosed ? 'redLine' : null} />
            </div>
        )
    }
}
